webpackJsonp([65961198590250],{429:function(e,n){e.exports={data:{markdownRemark:{html:'<p>The Fundamentals of the Web</p>\n<p><b>By</b> Josue Plaza</p>\n<p><b>Time Length</b>: 1 Hour, 20 minutes</p>\n<h3>Instructor Priorities</h3>\n<ul>\n<li>Participants must have Atom &#x26; Chrome installed.</li>\n<li>Participants should feel completely welcome and encouraged to open up and ask questions.</li>\n<li>Participants should learn HTML elements are, specifically: HEAD, BODY, NAVBAR, SECTION, DIV, and P</li>\n<li>Participants should learn the role CSS plays, and what a ID &#x26; class are</li>\n<li>Participants should learn that Bootstrap is a pre-defined CSS file.</li>\n</ul>\n<hr>\n<h3>Prerequisites</h3>\n<p>Software:</p>\n<ul>\n<li><a href="https://atom.io/">Atom</a></li>\n<li><a href="https://www.google.com/intl/en/chrome/browser/">Google Chrome</a></li>\n</ul>\n<h3>Workshop Description</h3>\n<p>The path to become a developer can be a mystifying experience at first. In this 2-hour workshop, Valley Tech will introduce you to the world of web development (and programming in general)! Regardless if you are interested in building your own web applications, or looking to change careers, this workshop is your (free) ticket into the developer world.</p>\n<p>You will dive head first into HTML/CSS, skill up with live coding exercises, and by the end of the day youâ€™ll have a working web page to call your own. Afterward, l will point you to online coding resources, and you can stay to hear more about our amplified 12-week courses in development.</p>\n<p>Takeaways from the workshop are:</p>\n<ul>\n<li>Basics of the internet and how webpages work</li>\n<li>Syntax of HTML and CSS</li>\n<li>Common types of websites including landing pages and marketing sites</li>\n<li>Principles of front-end code organization and project structure</li>\n<li>How to get your website live on the internet</li>\n<li>Building a basic web page from scratch</li>\n</ul>\n<p><strong>COME PREPARED</strong></p>\n<p>This workshop is for beginners!</p>\n<p>You <em>must</em> bring along a laptop and install the following free software before class: Atom <a href="https://atom.io/">https://atom.io/</a>\nGoogle Chrome <a href="https://www.google.com/intl/en/chrome/browser/">https://www.google.com/intl/en/chrome/browser/</a></p>\n<h3>1. Valley Tech Intro (6:35 - 6:40)</h3>\n<h3>2. Introduction: The World Wide Web (6:40-6:50)</h3>\n<p>Preface what we are going over, talk about the importance of web development today. Talk about the industry, careers, perhaps a tiny bit on History. Preface into HTML.</p>\n<h2>Talking points:</h2>\n<p>[Stop for Questions]</p>\n<h3>3. HTML: The Fundamental Building Block (6:50-7:00)</h3>\n<p>Talk about HTML. Begin first exercise and go over basic HTML syntax. Show the structure of some popular websites.</p>\n<p>Talk about:</p>\n<ul>\n<li>DOCTYPE</li>\n<li>HEAD</li>\n<li>BODY</li>\n<li>NAVBAR/HEADER</li>\n<li>SECTION, DIV, P, UL, TABLE, (etc.)</li>\n<li>FOOTER</li>\n</ul>\n<p>Preface into CSS</p>\n<p>[Stop for questions]</p>\n<h3>4. CSS: I LOVE CSS (7:00 - 7:10)</h3>\n<p>Talk about CSS Importance. Showcase all of the incredible things you can do with CSS, CSS2, CSS3</p>\n<p>Talk about IDs and Classes</p>\n<p>[Stop for questions]</p>\n<h3>5. Break Time (7:10 - 7:20)</h3>\n<h3>7. Site Practice; General Assistance (7:30 -7:40)</h3>\n<p>guide them to make continued progress with their websites</p>\n<h3>8. Ending; Future Education Opportunities; Valley Tech Plug (7:40-7:50)</h3>',headings:[{depth:3,value:"Instructor Priorities"},{depth:3,value:"Prerequisites"},{depth:3,value:"Workshop Description"},{depth:3,value:"1. Valley Tech Intro (6:35 - 6:40)"},{depth:3,value:"2. Introduction: The World Wide Web (6:40-6:50)"},{depth:2,value:"Talking points:"},{depth:3,value:"3. HTML: The Fundamental Building Block (6:50-7:00)"},{depth:3,value:"4. CSS: I LOVE CSS (7:00 - 7:10)"},{depth:3,value:"5. Break Time (7:10 - 7:20)"},{depth:3,value:"7. Site Practice; General Assistance (7:30 -7:40)"},{depth:3,value:"8. Ending; Future Education Opportunities; Valley Tech Plug (7:40-7:50)"}],frontmatter:{title:"Intro to Web Development"}}},pathContext:{slug:"/courses/intro-to-web-development/syllabus/"}}}});
